if mibBuilder.loadTexts: zhoneTrapFlags.setStatus('current')
if mibBuilder.loadTexts: zhoneTrapFlags.setDescription('This variable is sent with all traps and contains flags related to this trap. trapAcknolwedge: If this bit is set, it indicates to the ZMS that the trap must be acknowledged. Acknowledgement is accomplished by the ZMS sending a SET request to the variable zhoneTrapsAckedSequenceNumber in the zhoneTrapsTable. See the trap sequence number field description (value is 2147483648 and higher. trapOutOfSequence: If set, it indicates that this trap is being sent out of sequence from what the trap receiver is expecting. The specific occurence is when the trap receiver detects lost traps and requests resending of traps starting from a specific sequence number (see zhoneTrapsResendSequenceNumber) but the system does not have all these traps. Example: - traps 400-600 sent to the trap receiver. - trap 500 is lost - trap receiver requests resend of traps 500 and up. - system only has 550-600 saved in memory. - trap 550 resent with trapOutOfSequence set. - trap 551 and above resent with trapOutOfSequence reset. trapResetSequenceNumber: If set, the sender of this trap has reset the trap sequence number for this trap destination. It is indicating to the ZMS to also reset its sequence numbers.')
