if mibBuilder.loadTexts: zhoneSysSwAdmin.setDescription(' (1) downloadSw: Download the image from the Primary load Server. If that fails, try to download from secondary load server. This value is only allowed if the zhoneSysSwStatus field is NOT downLoadSwInProgress. (2) abortDownLoadSw: abort an in-progress download. This value is only allowed if the zhoneSysSwStatus is downLoadSwInProgress. (3) delete: deletes the filename specified in zhoneSysSwLocalFilePath. This is used by the manager to manage the amount of storage space used by the system for sw load images. A delete will fail if the file is specified in either a: default sw entry, specific software entry, or an upgrade software entry. This is only supported on devices having a file-system. (4) imageFlashActive: flashes the raw file specified in the zhoneSysSwLocalFilePath. This is used to update the raw boot area of the flash of the active infoserver. (5) imageFlashStandby: flashes the raw file specified in the zhoneSysSwLocalFilePath. This is used to update the raw boot area of the flash of the active infoserver. (6) downLoadFile: Download a file from the Primary load Server. If that fails, try to download from secondary load server. This value is only allowed if the zhoneSysSwStatus field is NOT operationInProgress. (7) upLoadFile: Upload a file to the Primary load Server. The file must already exists on the load server This value is only allowed if the zhoneSysSwStatus field is NOT operationInProgress. (8) dumpFile: dump the database to a local file. (9) dumpNetwork: dump the database to the primary load server. The file must already exists on the load server This value is only allowed if the zhoneSysSwStatus field is NOT operationInProgress. (10) restore (11) configScriptActivate: activate the configuration script file specified in the zhoneSysSwLocalFilePath. This value is only allowed if the zhoneSysSwStatus is NOT operationInProgress nor downloadSwInProgress. (12) configDatabaseActivate: activate the contents of a database file specified in the zhoneSysSwLocalFilePath. This value is only allowed if the zhoneSysSwStatus is NOT operationInProgress nor downloadSwInProgress. Activation of a new database may result in a reset of the system. (13) backupDatabase: backup device by uploading database file to zhoneSysSwLocalFilePath. (14) restoreDatabase: restore device database from zhoneSysSwLocalFilePath. This command will reboot device with restored database. ')
