if mibBuilder.loadTexts: zhoneSysCardSpecificSwFileName.setDescription("The file or code image name of the specific software version that should be loaded by the unit/card for operation. If a failure occurs when trying to boot an upgrade version, the system will automatically revert to a 'good' software version which is either the zhoneSysCardSpecificSwFileName if non-NULL or the default for this card type if it is NULL. The operation will vary if the unit is a BAN card or a standalone device. BAN: In the case of a BAN the card will load the indicated module and set cardSwStatus as appropriate. If the cardSpecificFileName is set to NULL then the card will load the image indicated by the zhoneSoftwareLoadTable in the system mib. STANDALONE: If the card is a Zedge,Sechtor, or similar device, the system will first check if there is a local copy of the code image indicated, if there is, the card will load from the local copy. If the local copy is not the same revision as zhoneSysCardSpecificSwFileName the card will load this file. ")
